- input: "TEXT\x1CC00135368\x1C.TEXT\x1C\x1CF3XA\x1CThe 30 day Post-General report
    is being amended to correct staff time information and to reflect the financial
    changes as the result of amendments made to the July 20 Monthly, August 20 Monthly,
    September 20 Monthly, October 20 Monthly, and 12 day Pre-General reports. As of
    January 31, 2013, the additional changes have been added to the Post-General amendment:
    Lawson Legate's expense of $26.84 originally listed as 'Salaries & Benefits' has
    been correct to 'In-Kind: Travel Reimbursement'. The amended report also accounts
    for Sarina Sawyer's 'salaries and benefits' listed on line 23 and  in the corresponding
    offset reported on line 21(b). Thte intial filing reported an excess of $150 for
    our total web voter guide expenses. The amended report sees an adjusted total
    less $150, and this change is now reflected in the new line 24 offsets reported
    on line 21(b). A duplicate donation resulting from an electronic database error
    has been removed from line 11 (Claire Martineau, $20).\n"
